def chunks(l, n):
    """ Yield successive n-sized chunks from l.
    """
    for i in range(0, len(l), n):
        yield l[i:i+n]


def grouped(iterable, n):
    "s -> (s0,s1,s2,...sn-1), (sn,sn+1,sn+2,...s2n-1), ..."
    return zip(*[iter(iterable)]*n)

def turn_symbols(byte):
    out = 0
    if byte & 0x01:
        out |= 0x02
    if byte & 0x02:
        out |= 0x01
    if byte & 0x04:
        out |= 0x08
    if byte & 0x08:
        out |= 0x04

    if byte & 0x10:
        out |= 0x20
    if byte & 0x20:
        out |= 0x10
    if byte & 0x40:
        out |= 0x80
    if byte & 0x80:
        out |= 0x40

    return out

